function Language( obj ){
	for( var prop in obj ){
	 	this[prop] = obj[prop];
	};
	this._chars = new Array();
	this._lines = new Array();
	this._essay = new Array();
	this._essay[0] = new Essay ( { text:this.text, lang : this.lang } );
}

function Essay( obj ){
	var lang = obj.lang;
	this.text = obj.text;
	var items = this.text.split( langMap[lang ].parabreak );
	this._paragraph = new Array();
	for( var prop in items ){
		if( items[prop] ) {
			this._paragraph[prop] = new Paragraph ( { text:items[prop], lang : lang } );
		}
	}
}

function Paragraph( obj ){
	var lang = obj.lang;
	this.text = obj.text;
	var re;
	var ac = langMap[lang ].sentbreak.ac;
	for(var prop in ac){
		re = eval("/"+ prop + "/g");
		if(re.test(this.text)){
			this.text = this.text.replace(re,ac[prop]);
		}
	};
	
	var data = this.text;
	var breaks = langMap[lang ].sentbreak.val;
	for( var prop in breaks ){
		eval('re= new RegExp("'+ breaks[prop] +'","g")');
		var results = re.exec( data );
		if( results ) {
			data = data.replace( re , results[0] + langMap[lang ].splitter );
		}
	};
	// trace( data );
	var items = data.split( langMap[lang ].splitter );

	this._sentence = new Array();
	for( var prop in items ){
		if( items[prop] ) {
	 		this._sentence[prop] = new Sentence ( { text:items[prop], lang : lang } );
		}
	}
}

function Sentence( obj ){
	var lang = obj.lang;
	this.text = obj.text;
	var data = this.text;
	var re;
	var breaks = langMap[lang ].clausebreak.val;
	for( var prop in breaks ){
		eval('re= new RegExp("'+ breaks[prop] +'","g")');
		var results =	re.exec( data );
		if( results ) {
			data = data.replace( re , results[0] + langMap[lang ].splitter );
		}
	};
	// trace( data );
	var items = data.split( langMap[lang ].splitter );

	this._clause = new Array();
	for( var prop in items ){
		if( items[prop] ) {
	 		this._clause[prop] = new Clause ( { text:items[prop], lang : lang } );
		}
	}
}

function Clause( obj ){
	var lang = obj.lang;
	this.text = obj.text;
	var data = this.text;
	var re;
	var results = [];

	var breaks = langMap[lang ].phraseBreak.val;
	for( var prop in breaks ){
		eval('re= new RegExp("'+ breaks[prop] +'","g")');
		var results =	re.exec( data );
		if( results ) {
			data = data.replace( re , results[0] + langMap[lang ].splitter );
		}
	};
	
	// trace( data );
	var items = data.split( langMap[lang ].splitter );
	
	this._phrase = new Array();
	for( var prop in items ){
		if( items[prop] ) {
			this._phrase[prop] = new Phrase ( { text:items[prop], lang : lang } );
		}
	}
	//this.properties = {};
	//this.grammer ( lang );
}

function Phrase( obj ){
	var lang = obj.lang;
	this.text = obj.text;
	var data = this.text;
	var re;
	var results = [];
	
	var breaks = langMap[lang ].charBreak.val;
	for( var prop in breaks ){
		eval('re= new RegExp("'+ breaks[prop] +'","g")');
		var tmp = data;
		var lastIndex = 0;
		while((results = re.exec(data)) != null) {
			//if(results.index>0) data.splice(results.index,0,langMap[lang ].splitter);
			//data.splice(results.index+results[0].length,0,langMap[lang ].splitter);
			data = data.substring(0, results.index) + (results.index>lastIndex?langMap[lang ].splitter:"") + results[0] + langMap[lang ].splitter +  data.substring(results.index+results[0].length,data.length) ;
			//data = data.replace(  results[0] , (results.index>0?langMap[lang ].splitter:"") + results[0] + langMap[lang ].splitter );
			lastIndex = re.lastIndex += langMap[lang ].splitter.length;
		}		
	};
	
	var items = data.split( langMap[lang ].splitter );
	
	this._character = new Array();
	for( var prop in items ){
		if( items[prop] ) {
			this._character[prop] = new Character ( { text:items[prop], lang : lang } );
		}
	}
}

function Character( obj ){
	var lang = obj.lang;
	this.text = obj.text;
}

